class Solution
{
public:
    /// @brief 找到所有 words 串联子串的起始位置（使用 KMP 优化）
    /// @param s 主字符串
    /// @param words 单词数组
    /// @return 所有符合条件的子串起始位置
    /// 
    /// 算法思路：滑动窗口 + 哈希表 + KMP 算法
    /// 1. 统计 words 中每个单词的出现次数
    /// 2. 使用 KMP 算法预处理每个单词的 next 数组
    /// 3. 对于每个可能的起始位置，使用 KMP 快速匹配窗口内的单词
    /// 4. 窗口大小为 words 中所有单词的总长度
    /// 5. 将窗口内的字符串按单词长度分割，使用 KMP 检查是否匹配
    ///
    /// 时间复杂度：O(n * m * k)，其中 n 是 s 的长度，m 是 words 的数量，k 是单词长度
    /// 空间复杂度：O(m * k)，用于存储单词计数和 KMP next 数组
    vector<int> findSubstrings(string s, vector<string>& words)
    {
        vector<int> result;
        if (s.empty() || words.empty()) return result;
        
        int wordLen = words[0].size();      // 每个单词的长度（假设所有单词长度相同）
        int wordCount = words.size();       // 单词数量
        
        // 边界检查：单词长度必须大于 0
        if (wordLen == 0) return result;
        
        // 检查所有单词长度是否相同
        for (const string& word : words)
        {
            if (word.size() != wordLen)
            {
                return result;  // 单词长度不一致，返回空结果
            }
        }
        
        int totalLen = wordLen * wordCount; // 串联子串的总长度
        
        if (s.size() < totalLen) return result; // 字符串长度不足，直接返回
        
        // 统计 words 中每个单词应该出现的次数
        unordered_map<string, int> wordCountMap;
        for (const string& word : words)
        {
            wordCountMap[word]++;
        }
        
        // 为每个单词预处理 KMP next 数组
        unordered_map<string, vector<int>> nextMap;
        for (const auto& pair : wordCountMap)
        {
            nextMap[pair.first] = getNext(pair.first);
        }
        
        // 从每个可能的起始位置开始检查
        for (int i = 0; i <= (int)s.size() - totalLen; i++)
        {
            // 创建当前窗口的单词计数映射（用于匹配）
            unordered_map<string, int> currentCount;
            bool valid = true;
            
            // 将窗口内的字符串按单词长度分割，使用 KMP 检查是否匹配
            for (int j = 0; j < wordCount; j++)
            {
                int startPos = i + j * wordLen;
                
                // 优化：对于固定长度的匹配，如果所有单词长度相同且较短，直接字符串比较可能更快
                // 但这里保留 KMP 以处理有重复前缀后缀的单词
                string matchedWord;
                bool found = false;
                
                // 遍历所有单词，使用 KMP 检查是否匹配
                for (const auto& pair : wordCountMap)
                {
                    const string& word = pair.first;
                    
                    // 快速检查：如果第一个字符不匹配，直接跳过
                    if (s[startPos] != word[0])
                        continue;
                    
                    // 对于固定长度的匹配，如果单词长度较短，直接比较可能更快
                    // 但保留 KMP 以处理复杂模式
                    if (wordLen <= 3)
                    {
                        // 短单词直接比较
                        if (s.compare(startPos, wordLen, word) == 0)
                        {
                            matchedWord = word;
                            found = true;
                            break;
                        }
                    }
                    else
                    {
                        // 长单词使用 KMP
                        if (KMPMatch(s, startPos, word, nextMap[word]))
                        {
                            matchedWord = word;
                            found = true;
                            break;
                        }
                    }
                }
                
                // 如果单词不匹配，则不匹配
                if (!found)
                {
                    valid = false;
                    break;
                }
                
                currentCount[matchedWord]++;
                
                // 如果当前单词出现次数超过预期，则不匹配
                if (currentCount[matchedWord] > wordCountMap[matchedWord])
                {
                    valid = false;
                    break;
                }
            }
            
            // 如果完全匹配，将起始位置加入结果
            if (valid)
            {
                result.push_back(i);
            }
        }
        
        return result;
    }

private:
    /// @brief 获取 KMP 算法的 next 数组
    /// @param pattern 模式串
    /// @return next 数组
    vector<int> getNext(const string& pattern)
    {
        int m = pattern.size();
        vector<int> next(m, 0);
        next[0] = -1;
        int j = 0;
        int k = -1;
        
        while (j < m - 1)
        {
            // k == -1 表示没有找到匹配的前缀，或者 pattern[j] == pattern[k] 表示找到了匹配
            if (k == -1 || pattern[j] == pattern[k])
            {
                j++;
                k++;
                next[j] = k;
            }
            else
            {
                // 不匹配时，k 回退到 next[k] 的位置
                k = next[k];
            }
        }
        return next;
    }
    
    /// @brief 使用 KMP 算法检查字符串从指定位置开始的子串是否匹配模式串
    /// @param s 主字符串
    /// @param startPos 起始位置
    /// @param pattern 模式串
    /// @param next KMP next 数组
    /// @return 是否匹配
    bool KMPMatch(const string& s, int startPos, const string& pattern, const vector<int>& next)
    {
        int n = s.size();
        int m = pattern.size();
        
        // 如果剩余长度不足，直接返回 false
        if (startPos + m > n) return false;
        
        // 优化：对于长度为 1 的模式串，直接比较即可，不需要 KMP
        if (m == 1)
        {
            return s[startPos] == pattern[0];
        }
        
        int i = startPos;  // 主串指针
        int j = 0;         // 模式串指针
        
        while (i < n && j < m)
        {
            // j == -1 表示模式串的第一个字符就不匹配，或者字符匹配成功
            if (j == -1 || s[i] == pattern[j])
            {
                i++;
                j++;
            }
            else
            {
                // 不匹配时，模式串指针回退到 next[j] 的位置
                j = next[j];
            }
        }
        
        // 如果模式串指针到达末尾，说明完全匹配
        // 同时检查匹配的长度是否正好等于模式串长度（避免部分匹配）
        return j == m && (i - startPos) == m;
    }
};





